import { useDispatch } from 'react-redux';

import { TABS } from '../redux/actions/type';

const Tabs = () => {

    return (
        TABS.map( tab => (
            <button className='btn'
                    onClick={() => dispatch()}
            >
                {tab}
            </button>
        ))
    )
}

export default Tabs;
